import React from 'react';
import { SearchNumContaner } from './CardCar.styled';
import Form from 'react-bootstrap/Form';
import "./styles.css"
import Button from 'react-bootstrap/Button';



export default function App() {
  return (
    <SearchNumContaner>
      <Form.Label htmlFor="inputPassword5"  id = "LabelEnterNum">Введите номер</Form.Label>
      <Button variant="success">Поиск</Button>

      <Form.Control type="text" id="inputPassword5" aria-describedby="passwordHelpBlock" />
      <Form.Text id="passwordHelpBlock" className = "passwordHelp">
        Номер дожен соответсвовать регламентам Украины
      </Form.Text>
    </SearchNumContaner>
  );
}
